import React, { Component } from 'react';
import { Div3, Div6,H1 ,INPUT,P} from '../styles/styles';

class InterfaceRegistro extends Component {
    render() {
        return (
           
            <Div6 >
                <H1>Welcome back</H1>
         
                <P>Sign in to an existing account
                    using your phone number</P>
            <Div7>
                <form>
                    <INPUT type="text" placeholder='Number Phone' />
                    <INPUT type="text"  placeholder='Password'/>
                </form>

            </Div7>
            
            
            </Div6>

          
           

        )
    }s
}

export default InterfaceRegistro;
